export default class extends React.Component {
  render() {
    return (
      <div>
        <div>
          <img src="/rick-and-morty.png" alt="Rick and Morty" />
          <h1>Creado por FAD!</h1>
          <div>
            <p>Curso de Next.js</p>
            <span>
              <img src="/platzi-logo.webp" alt="Platzi" />
              <p>Platzi</p>
            </span>
          </div>
        </div>

        <style jsx>{`
          div {
            display: flex;
            flex-directio: column;
          }
          img {
            max-width: 1024px;
          }
          div div {
            display: flex;
            align-items: center;
          }
          span {
            display: flex;
            margin-left: 10px;
          }
          span img {
            width: 40px;
            height: 40px;
            margin-right: 10px;
          }
        `}</style>
      </div>
    )
  }
}
